import React, { useEffect } from 'react';
import { Provider } from 'react-redux';
import store from '../store/store';
import OrderList from '../components/OrderList';
import TotalOrderValue from '../components/TotalOrderValue';
import { loadOrders } from '../actions/orderActions';

function Home(userDetails) {
    const user = userDetails.user;

    const logout = () => {
        window.open(`${process.env.REACT_APP_API_URL}/auth/logout`, "_self");
    };

    useEffect(() => {
        fetch('/data.json')
            .then((response) => response.json())
            .then((data) => {
                store.dispatch(loadOrders(data));
            });
    }, []);

    return (
        <div className="min-h-screen bg-gray-100 flex flex-col">
            <header className="bg-white shadow-md p-4 sticky top-0 z-10">
                <div className="container mx-auto flex justify-between items-center">
                    <h1 className="text-3xl font-bold">Home</h1>
                    <button
                        className="bg-red-500 hover:bg-red-600 text-white rounded-lg px-4 py-2"
                        onClick={logout}
                    >
                        Log Out
                    </button>
                </div>
            </header>
            <Provider store={store}>
                <main className="flex-grow container mx-auto p-4 flex flex-col">
                    <div className="">
                        <h2 className="text-xl font-semibold">Order Management System</h2>
                        <TotalOrderValue />
                    </div>
                    <div className=" overflow-hidden bg-white rounded-lg shadow-md p-4">
                        <OrderList />
                    </div>
                </main>
            </Provider>
        </div>
    );
}

export default Home;
